export const gameInfo = {
  time: {
    localstoragekey: "time",
    data: [30, 45, 60],
  },
  size: {
    localstoragekey: "size",
    data: { Small: 160, Normal: 200, Large: 240 },
  },
  yeild: {
    localstoragekey: "yeild",
    data: {
      "Mongolian Steppe": 0.4,
      "European Average": 0.6,
      "Belorusian Magic": 0.8,
    },
  },
};
